import React from 'react';
import { Article } from '../../components';
import { blog01, blog02, blog03, blog04, blog05 } from "./imports";
import './blog.css';

const Blog = () => (
  <div className="gpt3__blog section__padding" id="blog">
    <div className="gpt3__blog-heading">
      <h1 className="gradient__text">A lot is happening, We are blogging about it.</h1>
    </div>
    <div className="gpt3__blog-container">
      <div className="gpt3__blog-container __groupA">
        <Article blogPhoto={blog01} date="May 12, 2022" />
      </div>
      <div className="gpt3__blog-container __groupB">
        <Article blogPhoto={blog02} date="May 12, 2022" title="GPT3" />
        <Article blogPhoto={blog03} date="May 12, 2022" />
        <Article blogPhoto={blog04} date="May 12, 2022" />
        <Article blogPhoto={blog05} date="May 12, 2022" />
      </div>
    </div>
  </div>
);

export default Blog;
